import React from 'react';
import Layout from '../Layout/Layout';
import Card from '../Card/Card';
import './style.css';

function Home(props) {
  return (
    <div>
      <div className='hero__div'>
        <Card width='100%'></Card>
      </div>

      <Layout>
        <Card>
          <h1>This is home</h1>
        </Card>
      </Layout>
    </div>
  );
}

export default Home;
